import logo from './logo.svg';
import './App.css';
import ListaUsuarios from './ListaUsuarios';
import AgregarUsuarios from './AgregarUsuarios';
import EditarUsuario from './EditarUsuario';

// para utilizar los path es necesario instalar el reach router nmp install react-router-dom
import {BroserRouter,Routes,Route} from 'react-router-dom';

function App() {
  return (
    <div> 
      <h1>Consultorio Online</h1>
      <BroserRouter>
      <Routes>
        <Route path='/' element={<ListaUsuarios/>} exact></Route>
        <Route path='/agregarusuarios' element={ <AgregarUsuarios/>}></Route>
        <Route path='/editarusuarios' element={ <EditarUsuario/>}></Route>
      </Routes>
      </BroserRouter>





  </div>

  );  
}

export default App;
